import React, { Fragment, useState } from "react";
import "./List.css";

function List({ data }) {
  const [expanded, setExpand] = useState({
    isExpanded: false,
    expandedIndex: -1,
  });

  const handleListExpand = (index) => {
    console.log(data[index]);
    return setExpand({
      isExpanded: true,
      expandedIndex: index,
    });
  };

  console.log(data);

  if (data.child) {
    return (
      <ul className="list__items">
        <li className="list__item">{data.title}</li>
        <List data={data.child} />
      </ul>
    );
  }

  return (
    <ul className="list__items">
      <li className="list__item">{data.title}</li>
    </ul>
  );
}

export default List;
